■お取り寄せの為、ご注文を頂いた時点で完売となっている可能性がございます。 その場合はご連絡させて頂きますので予めご了承ください<table width="600" border="0" align="center" cellpadding="0" cellspacing="0"><tr><td><font color="#009999" size="5"><strong>液を注ぐだけ!!有機酸パワーでカンタン洗浄!!</strong></font></td></tr></table><br><table width="610" border="0" align="center" cellpadding="1" cellspacing="0"><tr><td width="610" valign="top" align="center"><div><img src="http://image.rakuten.co.jp/tuhan-ya/cabinet/t_simple5300/1004187-01.jpg" width="600" height="600"><br><font size=3></font></div><br><table width="600" border="0" align="center" cellpadding="1" cellspacing="0"><tr><td width="600" valign="top" align="left"><font size="3">【用途】<br>便器・タイルなど陶磁器の洗浄<br><br>【使用方法】<br>1.ポリ手袋など水分をはじく手袋をします。<br>容器上部の白いキャップを外します。(容器側面を強く押すと中身が飛び出しますのでご注意ください。)<br>2.便器の尿石汚れ(黄ばんでいる部分)に容器側面を押し、ふりかけます。<br>3.容器は必ず液の出口が下向きになるように使います。<br>上向きになる場合や便器側面等本液が垂れてしまう場合にはトイレットペーパー等に液を含ませ貼り付けます。<br>4.尿石汚れに反応して泡が発生する場合があります。<br>5.20分程度貼りつけた後、汚れの成分が分解したら多量の水で洗い流してください。<br>6.汚れの落ち具合が不十分な場合は、上記作業を繰り返します。<br>便器周りのセメントのタイル目地の黄ばみ・黒ずみ汚れの洗浄にも使えます。<br>この場合は本液を汚れ部分にふりかけ使い古しの歯ブラシ等で擦り、直ちに水洗いして下さい。<br><br>【使用量の目安】<br>便器の黄ばみ除去:1回/約50ml<br><br>【使えないもの】<br>・無水小便器、大理石、御影石、その他鏡面仕上げの各種石材、ガラス製品、金属製品、美術品、骨董品には使えません。<br>・本品は酸性製品です。スプレー容器に移しての使用はおやめください。ミストを吸い込み危険です。また、メガネレンズ、車、窓ガラスに付着すると変質する恐れがあります。<br>・便器の水あか、黒ずみ、わじみ汚れの洗浄に使用しても効果はありません。</font></td></tr></table><br><br><table width="600" cellspacing="0" cellpadding="0" border="0" align="center"><tr><td width="600" valign="top"><div align="center"><img width="545" height="653" src="http://image.rakuten.co.jp/tuhan-ya/cabinet/t_simple5300/1004187-02.jpg"><br><font size="3"></font></div><br></td></tr></table></td></tr></table><table width="600" border="0" align="center" cellpadding="1" cellspacing="0"><tr><td width="600" valign="top" align="left"><br><font size="3">便器内のこびり付いた尿石を有機酸が溶解し、悪臭の元を一掃します。便器側面の液ダレする部分には湿布効果で落します。酸性洗浄液のミストを飛ばさない押し出しタイプ。</font></td></tr></table><br><span style="padding:0;margin:0;font-size:0;color:#fff;">fk094igrjs</span><!--ab--><!--ab2015.6-->■お取り寄せの為、ご注文を頂いた時点で完売となっている可能性がございます。  その場合はご連絡させて頂きますので予めご了承ください<br><table width="300" border="0" cellspacing="0" cellpadding="0"><tr><td><font color="#333333" size="-1">便器内のこびり付いた尿石を有機酸が溶解し、悪臭の元を一掃します。便器側面の液ダレする部分には湿布効果で落します。酸性洗浄液のミストを飛ばさない押し出しタイプ。</font></td></tr></table><br><table width="300" border="0" cellpadding="5" cellspacing="1" bgcolor="#666666"><tr bgcolor="#FFFFFF"><td align="center" nowrap bgcolor="#FFFFCC"><font color="#333333" size="-1">サイズ</font></td><td align="left"><font color="#333333" size="-1">個装サイズ：15×8×20cm</font></td></tr><tr bgcolor="#FFFFFF"><td align="center" nowrap bgcolor="#FFFFCC"><font color="#333333" size="-1">重量</font></td><td align="left"><font color="#333333" size="-1">個装重量：1100g</font></td></tr><tr bgcolor="#FFFFFF"><td align="center" nowrap bgcolor="#FFFFCC"><font color="#333333" size="-1">成分</font></td><td align="left"><font color="#333333" size="-1">有機酸、腐食防止剤</font></td></tr><tr bgcolor="#FFFFFF"><td align="center" nowrap bgcolor="#FFFFCC"><font color="#333333" size="-1">仕様</font></td><td align="left"><font color="#333333" size="-1">液性:酸性</font><br></td></tr><tr bgcolor="#FFFFFF"><td align="center" nowrap bgcolor="#FFFFCC"><font color="#333333" size="-1">セット内容</font></td><td align="left"><font color="#333333" size="-1">280ml×3本セット</font></td></tr><tr bgcolor="#FFFFFF"><td align="center" nowrap bgcolor="#FFFFCC"><font color="#333333" size="-1">製造国</font></td><td align="left"><font color="#333333" size="-1">日本</font></td></tr></table><!--ab--><!--ab2015.6-->・広告文責(株式会社創和　0299-47-0506)<style type="text/css">
