■お取り寄せの為、ご注文を頂いた時点で完売となっている可能性がございます。 その場合はご連絡させて頂きますので予めご了承ください<table width="600" border="0" align="center" cellpadding="0" cellspacing="0"><tr><br /><td><img src="http://image.rakuten.co.jp/tuhan-ya/cabinet/number_only_02/0100384-01.jpg" width="600" height="1139"><br><br /><img src="http://image.rakuten.co.jp/tuhan-ya/cabinet/number_only_02/0100384-02.jpg" width="600" height="873"><br><br /><img src="http://image.rakuten.co.jp/tuhan-ya/cabinet/number_only_02/0100384-03.jpg" width="600" height="1072"><br><br /><img src="http://image.rakuten.co.jp/tuhan-ya/cabinet/number_only_02/0100384-04.jpg" width="600" height="700"></td><br /></tr></table><table width="550" align="center" border="0" cellspacing="1" cellpadding="10" bgcolor="#999999"><tr><br /><td bgcolor="#FFFFFF"><font color="#333333" size="-1">成分：水、界面活性剤（0.3％、ポリオキシエチレンアルキルフェニルエーテル）、d-リモネン、酵素</font></td></tr></table><br><br /><table width="600" border="0" align="center" cellpadding="0" cellspacing="0"><tr><br /><td><h1><font color="#333333" size="3">業務用のトイレ洗浄剤を使いやすいご家庭仕様に！果実由来の酵素と植物由来の洗浄成分で便器のフチ裏の汚れを洗浄＆除菌！</font></h1></td></tr></table><!--ab--><!--ab2015.6-->■お取り寄せの為、ご注文を頂いた時点で完売となっている可能性がございます。  その場合はご連絡させて頂きますので予めご了承ください<br><table width="300" border="0" cellspacing="0" cellpadding="0"><tr><br /><td><font color="#333333" size="-1">掃除しにくい便器のフチ裏の汚れを洗浄＆除菌☆植物由来の洗浄成分と果実由来の酵素で汚れを分解！さらに特殊酵素で徐々に尿石を分解！家庭用に使いやすい泡で出てくるスプレータイプです。</font></td><br /></tr></table><br><table width="300" border="0" cellpadding="5" cellspacing="1" bgcolor="#666666"><tr bgcolor="#FFFFFF"><br /><td width="25%" align="center" nowrap bgcolor="#FFFFCC"><font color="#333333" size="-1">内容量</font></td><br /><td width="75%" align="left"><font color="#333333" size="-1">200ml</font></td></tr><tr bgcolor="#FFFFFF"><br /><td align="center" bgcolor="#FFFFCC"><font color="#333333" size="-1">仕様</font></td><br /><td align="left"><font color="#333333" size="-1">液性：弱アルカリ性<br>用途：便器の洗浄<br>使用量の目安：1回約4～5秒で6～8回使用可能</font></td></tr><tr bgcolor="#FFFFFF"><td align="center" bgcolor="#FFFFCC"><font color="#333333" size="-1">製造国</font></td><br /><td align="left"><font color="#333333" size="-1">日本</font></td></tr></table><!--ab--><!--ab2015.6-->・広告文責(株式会社創和　0299-47-0506)<style type="text/css">
