スクラビングバブル トイレスタンプクリーナー フレッシュソープの香り つけかえ用 2本パック<br>ブランド：スクラビングバブル<br>販売・製造元：ジョンソン<br><br>トイレ用洗浄剤です。<br>トイレの水を流すと、濃縮ジェルが洗浄、防汚成分が溶け出し、マラゴニー効果の働きで、水たまりからフチ裏まで全体に行き渡ります。<br>防汚効果が続くので、汚れが積み重ならず、いつもピカピカに保ちます。<br>つけかえ用2本パック。<br>約12週間分。<br>フレッシュソープの香り。<br> <br>用途：洋式トイレの便器の内側(浄化槽への影響はありません。<br> <br><br>使用方法<br>ご使用前に、便器の内側を掃除してから、本品をご使用ください。<br>1.ジェル容器のボタンを青の持ち手(別売り)の1つ目の目盛(穴)にカチッとはめ込む。<br>2.キャップをはずし、ジェル容器の先端を、便器内側の平らな面にピッタリと押し当てる。<br>3.ボタンが次の目盛(穴)に入るまで持ち手を便器の方に押し進める。<br>ジェル容器を便器から離すと、1回分のジェルがつく。<br>※使用後はキャップをしっかりと閉め、そのまま箱に保管する。<br><br>●使用量目安：1回当たり1目盛(約6.3g)<br>●1回分のスタンプで約1週間使用できます。<br>(水温や使用環境により異なります。)<br>●ジェルが無くなった時が、付け替えの目安です。<br> <br><br>使用上の注意<br>●使用の際は、目や皮膚、衣類につかないように注意する。<br>●使用後は必ず手を洗う。<br>●用途以外に使用しない。<br>(ジェルは、食べられません。)<br>●安全に使用するため、外箱は使用期間中保管しておく。<br>●直射日光を避け、温度や湿度が高くなるところに置かない。<br>●子供やペットが触れる場所に置かない。<br>●ジェルの乾燥を避けるため、ジェルをつけた後は、毎回必ずキャップをしっかりと閉める。<br>●表面がコーティング加工されている便器は、効果が期待できない場合がある。<br>●万が一、ジェルが便器の内側に落ちた場合は、そのままトイレの水を流す。<br> <br>応急処置<br>●ジェルが目についた場合：こすらず、すぐ流水で充分に洗い流す。<br>異常がある場合は眼科医に相談する。<br>●ジェルを誤って食べた場合：吐かせず、コップ1-2杯の水を飲ませ、ただちに医師に相談する。<br>※いずれの場合も受診時は箱と一緒に商品を持参する。<br>●ジェルが皮膚についた場合：水で充分洗い流す。<br> <br>品質表示<br>●液性：弱酸性<br>●成分：界面活性剤(35%ポリオキシエチレンアルキルエーテル、アルキルエーテル硫酸エステルナトリウム)、溶剤、香料、安定化剤<br> <br>原産国：メキシコ <br><br>お問い合わせ先<br>ジョンソン株式会社TEL 045-640-2111 <br>日用品／掃除用品／掃除用洗剤／洗剤 トイレ用<br>JANコード： 4901609004351<br><br>CS：12<br>広告文責：アットライフ株式会社<br>TEL 079-280-2113<br>※商品パッケージは変更の場合あり。<br>メーカー欠品または完売の際、キャンセルをお願いすることがあります。ご了承ください。<br><style type="text/css">
